import React, {useState} from 'react'
import { Link } from 'react-router-dom';
import Navbar from './navbar';
import Footer from './footer'
import { Baseurl } from '../baseurl';
import axios from 'axios';
import Latest_courses from './latest_courses';
import Back_to_top from './back_to_top';
import { Formik, Form, Field, ErrorMessage } from 'formik';



// import Swal from 'sweetalert2'
// import axios from 'axios';
// import {Baseurl} from '../components/Baseurl.js';

// const Toast = Swal.mixin({
//   toast: true,
//   position: 'top-end',
//   showConfirmButton: false,
//   timer: 500,
//   timerProgressBar: true,
//   didOpen: (toast) => {
//   toast.addEventListener('mouseenter', Swal.stopTimer)
//   toast.addEventListener('mouseleave', Swal.resumeTimer)
//   }
// })

// const Toast2 = Swal.mixin({
//   toast: true,
//   position: 'top-end',
//   showConfirmButton: false,
//   timer: 1500,
//   didOpen: (toast) => {
//   toast.addEventListener('mouseenter', Swal.stopTimer)
//   toast.addEventListener('mouseleave', Swal.resumeTimer)
//   }
// })


const Login = () => {

  return (
    <>
    
      <Navbar />
      <section className="about container-fluid mt-4" id="about">
        <div className="row">
          <div className="col-lg-5  d-lg-block order-2 order-lg-1" data-aos="fade-in" data-aos-delay="100">
            <small className='px-3 pb-2'><strong><i class="fad fa-chalkboard-teacher" style={{ color: '#0D826E' }}></i> Learn a skill today, Be smart!</strong></small>

            <img src="assets/img/student2.jpg" className="img-fluid login-img mt-2" alt="" style={{ borderRadius: '10px' }} />
          </div>

          <div className="col-lg-6 order-1 order-lg-2 mb-4" data-aos="fade-in" data-aos-delay="100">


            <div class="login-card" style={{ borderRadius: '10px' }}>
              <div class="section-title">
                <h2><strong>LOGIN PAGE</strong></h2>
              </div>
              <Formik
       initialValues={{ email: '', password: '' }}
       validate={values => {
         const errors = {};
         if (!values.email) {
           errors.email = '*Email Required';
         } else if (
           !/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i.test(values.email)
         ) {
           errors.email = 'Invalid email address';
         }else if(!values.password){
          errors.password = '*Password Required';
         }
         return errors;
       }}
       onSubmit={(values, { setSubmitting }) => {
         setTimeout(() => {
           alert(JSON.stringify(values, null, 2));
           setSubmitting(false);
         }, 400);
       }}
     >
       {({ isSubmitting }) => (
       
          <Form>


          <div class="row-1">
            <div class="row row-2"> <span id="login-card-inner">Email</span> </div>
            <div class="row row-2"> <Field type="email" placeholder="Registered Email" name="email"/>
            <ErrorMessage name="email" component="small" className='text-danger'/> </div>
          </div>


          <div class="row-1">
            <div class="row row-2"> <span id="login-card-inner">Password</span> </div>
            <div class="row row-2"> <Field type="password" placeholder="Password" name="password"/>
            <ErrorMessage name="password" component="small"className='text-danger' /> </div>
          </div>
          <button class="btn d-flex mx-auto" type="submit" disabled={isSubmitting}><b>Login</b></button>
        </Form>
       )}
     </Formik>
             
            </div>
          </div>

        </div>
      </section>

      <Latest_courses />
      <Back_to_top />
      <Footer />
    </>
  );
};

export default Login;
